import React from "react";

const Jobs =()=>{
    const [data, setData] = React.useState(null);

    React.useEffect(() => {
        fetch("/results")
          .then((res) => res.json())
          .then((data) => setData(data.result));
      }, []);
      const arr=[];
      console.log(data);
    if(data){
     data.map(job=>{
         arr.push(job);
     })
    }
    return(
        <div>
            {arr.length==0 ? <p>"Loading..."</p> : 
              
            arr.map(job => {
                 return(<div style={{color:"black"}} key={job.title}>{job.title}</div>)
                })
             }
        </div>
    )
}
export default Jobs
